import groovy.sql.Sql
def holder = new com.eviware.soapui.support.XmlHolder( mockRequest.requestContent )

log.info "entro in invioSAP"

def r = Math.random()
if( r < 0.34 )
   {
   // in 1/3 dei casi restituisco X001
   log.info "esco da invioSAP"
   return "Resp_err_X001"
   }
else
{
   // altrimenti elaboro la richiesta	
   // prelevo la SAP dalla richiesta
   def sap = holder["//*:SAP"].toString()
   log.info "SAP nella richiesta:" + sap


   def identificativosap = ""
   def sapcompleta = ""
   // se è una nuova SAP allora
   if( sap.contains("<identificativosap>") == false )
   {
   	  // è una SAP nuova
       // genero un codice SAP random
       def num = Math.abs(new Random().nextInt() % 89999999) + 10000000
       identificativosap = "ZZ" + num + "Z"
       log.info "identificativosap:" + identificativosap

       //aggiungo il codice SAP alla SAP in input
       sapcompleta = sap.replaceAll("</dataultimoagg>","</dataultimoagg>\n<identificativosap>"+identificativosap+"</identificativosap>")
       sapcompleta = "<![CDATA[" + sapcompleta + "]]>"
       log.info "SAP completata:" + sapcompleta
   } else {
       // NON è una SAP nuova 
       identificativosap = sap.substring(sap.indexOf("<identificativosap>") + 19 ,sap.indexOf("</identificativosap>") )
       log.info "identificativosap:" + identificativosap
       sapcompleta = "<![CDATA[" + sap + "]]>"   	
   }

   if (!context.dbConnection) {
   	log.info "Connessione non disponibile. Verificare la connessione nello script di avvio."
   	return;
   }

   // eseguo la insert sulla tabella sap con colonne [identificativosap,risposta]
   try {
      context.dbConnection.execute("insert into sap (identificativosap,risposta) values(?,?)", [identificativosap,sapcompleta])
      context.session = identificativosap

      log.info "esco da invioSAP"
      return "Resp_from_DB"
   } 
   catch (Exception ex) { 
   	 // insert in errore
      log.info "esco da invioSAP"
      return "Resp_error_other" 
   }


}

import groovy.sql.Sql
def holder = new com.eviware.soapui.support.XmlHolder( mockRequest.requestContent )

log.info "entro in richieataSAP_N00_A02"

def r = Math.random()
if( r < 0.34 )
   {
   // in 1/3 dei casi restituivo X001
   log.info "esco da richieataSAP_N00_A02"
   return "Resp_err_X001"
   }
else
{
   // altrimenti elaboro la richiesta	
   // prelevo il codice fiscale dalla richiesta
   def codicefiscale=""
   def codicefiscalecontainer = ""
   def indexofstart = -1
   def indexofend = -1

   codicefiscalecontainer = holder["//*:CodiceFiscale"].toString()
   indexofstart = codicefiscalecontainer.indexOf("<codiceFiscale>", 1)

   if (indexofstart == -1)
   	codicefiscale = codicefiscalecontainer
   else {
     indexofend = codicefiscalecontainer.indexOf("</codiceFiscale>", 1)
     codicefiscale = codicefiscalecontainer.substring(indexofstart+15,indexofend)
   }  
   log.info "codicefiscale:" + codicefiscale

//   if (codicefiscale == "CLDLCN80A41F839U")
//     {
//     return "Resp_err_X001"
//     }

   if (!context.dbConnection) {
   	log.info "Connessione non disponibile. Verificare la connessione nello script di avvio."
   	return;
   }

   // eseguo la query sulla tabella test_soapui.sap con colonne [identificativosap,risposta]
   def row = context.dbConnection.firstRow("select risposta from did where codicefiscale = ?", [codicefiscale])
   if( row != null )
   {
	// La query restituisce risultati
	context.session = row.risposta

     log.info "esco da richieataSAP_N00_A02"
     return "Resp_from_DB"
   }
   else 
   {
	// La query non restituisce risultati

     log.info "esco da richieataSAP_N00_A02"
	return "Resp_DID_not_found"
   }

}
